    return (
        <div className="relative flex w-full h-screen bg-white"
        style={{
          backgroundImage: "url('./pexels-alex-andrews-271121-861443.png')",
          backgroundSize: "cover",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
        }}> 


        <div className="flex-col w-1/3"> <div className=" text-black font-black mt-20 ml-20 text-7xl">software <br></br>engineer</div>
        <div className="mt-40 ml-20 text-justify">
        <a className="mt-20 text-sm  ">I am a skilled software developer specializing in web development and Java programming. With expertise in MERN stack and WordPress, I have successfully delivered a variety of online projects. My passion lies in crafting efficient and user-friendly solutions that leverage cutting-edge technologies to solve complex challenges.</a>
        </div>

        </div>





        <div className="flex w-1/3 w-full h-screen bg-" style={{
        backgroundImage: "url('./image 1.png')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
      }}>



        </div>
        <div className="flex w-1/3 "></div>









        </div>
    )
}
